import React from 'react';
import style from './ModalOkno.module.scss'
import {useDispatch} from "react-redux";
import {reset} from "../../redux/slices/filterSlice";
function ModalOkno({selectedMedicine}) {
    const {  imageUrl, name, price } = selectedMedicine
    const dispatch = useDispatch()
    const close = () => dispatch(reset())
    const handleBackdropClick = (event) => {
        if(event.target === event.currentTarget) {
            close()
        }
    }
    return (
        <div>
            <div className={style.modal_backdrop} onClick={handleBackdropClick}>
                <div onClick={close} className={style.close}></div>
                <div className={style.modal_content}>
                    <div onClick={close} className={style.close}>
                     </div>
                    <div>
                        <img className={style.img_modal} src={imageUrl} alt="" />
                    </div>
                    <div className={style.content_data}>
                        <div className={style.wrapper_text}>
                            <div className={style.text_one}>
                                <div>name: </div>
                                <div>age: </div>
                                <div>email: </div>
                                <div>phone: </div>
                                <div>about: </div>
                            </div>
                            <div className={style.text_two}>
                                <div>{name}</div>
                                <div>{age}</div>
                                <div>{email}</div>
                                <div>{phone}</div>
                                <div>{about}</div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default ModalOkno;
